var UTILITIES={getRandomInt:function(t,e){return Math.floor(Math.random()*(e-t+1)+t)},getNumberWithEnding:function(t){return t<=0?0:t%100==10||t%100==11||t%100==12||t%100==13||t%10==4||t%10==5||t%10==6||t%10==7||t%10==8||t%10==9||t%10==0?t.toString()+"th":t%10==1?t.toString()+"st":t%10==2?t.toString()+"nd":t%10==3?t.toString()+"rd":void 0},getTimeDisplay:function(t){if(console.log("timeSeconds: %s",t),t>0){var e=Math.floor(t/60),n=t-60*e;return UTILITIES.strPadLeft(e,"0",2)+":"+UTILITIES.strPadLeft(n,"0",2)}return"00:00"},strPadLeft:function(t,e,n){return(new Array(n+1).join(e)+t).slice(-n)},titleCase:function(t){let e="";if(t){e=t.toLowerCase().split(" ");for(var n=0;n<e.length;n++)e[n]=e[n].charAt(0).toUpperCase()+e[n].substring(1);e=e.join(" ")}return e},splitCamelCase:function(t){return t?t.replace(/([A-Z]+)/g,"$1").replace(/([A-Z][a-z])/g," $1"):""},splitAndTitleCase:function(t){return UTILITIES.titleCase(UTILITIES.splitCamelCase(t))},isNumber:function(t){return!isNaN(parseFloat(t))&&isFinite(t)}};